null},"id":"910e1beb-f4b8-47ef-9683-1503c490c778","type":"GlyphRenderer"},{"attributes":{"dimension":1,"grid_line_color":{"value":null},"plot":{"id":"a10b2faf-4d3c-4c3c-b578-4c8301d13b23","subtype":"Figure","type":"Plot"},"ticker":{"id":"01a3715f-f19d-4cfc-96aa-83c709815b57","type":"BasicTicker"}},"id":"d904d0f0-b5eb-4e53-a7d2-c11dda7c9515","type":"Grid"},{"attributes":{"args":{"slider":{"id":"0fcf0e32-6fc5-4f38-950e-05fc17d23a3c","type":"Slider"},"source_rg":{"id":"f4c02a7c-e0ab-4b80-acab-c43ad67f02d5","type":"ColumnDataSource"},"source_vy":{"id":"781155c2-2e88-41a9-87d2-e2c6cae4bcf3","type":"ColumnDataSource"}},"code":"\nfunction eq_vx(hx,rc){\n    return (2*hx - 1 + Math.sqrt(1-4*rc*hx*(1-hx)))/(2*(1-rc));\n}\n\nfunction eq_hx(hx,rc){\n    var vg = eq_vx(hx,rc);\n    var ve = 1 - hx;\n    return vg/(vg + ve)\n}\n\nfunction ratio_vx(hx,rc){\n    return 1/(1 - rc*eq_hx(hx,rc))\n}\n\nfunction eq_rg(hx,rc,rg){\n    return rg*Math.sqrt(1./(1 - rc*eq_hx(hx,rc)*(1-Math.pow(rg,2))))\n}\n\nfunction ratio_vy(hx,rc,rg){\n    return 1/(1-rc*eq_hx(hx,rc)*Math.pow(eq_rg(hx,rc,rg),2))\n}\n\nfunction ratio_rg(hx,rc,rg){\n    return eq_rg(hx,rc,rg)/rg\n}\n\n    function update_vy(hx,source){\n        var data = source.data;\n        \n        var rg   = data['rg'];\n        var rc   = data['rc'];\n        var c    = data['c'];\n        var a    = data['a'];\n        var y    = data['y'];\n\n        for(i = 0; i < y.length; ++i){\n            y[i] = Math.log(ratio_vy(hx,rc[i],rg[i]));\n            if(isNaN(y[i])){\n                y[i] = 0\n            }\n        }\n        ymax = 2//Math.max(Math.max.apply(null,y),-Math.min.apply(null,y))\n\n        for(i = 0; i < y.length; ++i){\n            if(y[i] > 0){\n                a[i] = Math.log2(1+y[i]/ymax);\n                c[i] = \"red\" \n            } else {\n                a[i] = -Math.log2(1+y[i]/ymax);\n                c[i] = \"blue\"\n            }\n        }\n        source.trigger('change')\n    }\n\n    function update_rg(hx,source){\n        var data = source.data;\n        \n        var rg   = data['rg'];\n        var rc   = data['rc'];\n        var c    = data['c'];\n        var a    = data['a'];\n        var y    = data['y'];\n\n        for(i = 0; i < y.length; ++i){\n            y[i] = Math.log(ratio_rg(hx,rc[i],rg[i]));\n            if(isNaN(y[i])){\n                y[i] = 0\n            }\n        }\n        ymax = 1.5//Math.max(Math.max.apply(null,y),-Math.min.apply(null,y))\n\n        for(i = 0; i < y.length; ++i){\n            if(y[i] > 0){\n                a[i] = Math.log2(1+y[i]/ymax);\n                c[i] = \"red\" \n            } else {\n                a[i] = -Math.log2(1+y[i]/ymax);\n                c[i] = \"blue\"\n            }\n        }\n        source.trigger('change')\n    }\n\n    var hx   = slider.value;\n    update_vy(hx,source_vy)\n    update_rg(hx,source_rg)\n"},"id":"57dd5da0-e4f3-48bc-bc6d-52c2bf200ea6","type":"CustomJS"},{"attributes":{"callback":null,"js_callbacks":{"change:value":[{"id":"57dd5da0-e4f3-48bc-bc6d-52c2bf200ea6","type":"CustomJS"}]},"step":0.01,"title":"Heritability of A under random mating","value":0},"id":"0fcf0e32-6fc5-4f38-950e-05fc17d23a3c","type":"Slider"}],"root_ids":["25c57f8a-1b26-4e32-8e32-c32014582488"]},"title":"Bokeh Application","version":"0.12.4"}};
